	(1, '516000000', 2, 1, 'Empat Kelurahan Berlomba Merebut Gelar Terbaik', 'HUMAS (Rilis Pers)- Sebanyak empat Kelurahan terbaik se- Kota Tanjungpinang mengikuti ekspose kinerja aparatur kelurahan dan masyarakat. DariÂ empat kelurahan, satu kelurahan terbaik akan dipilih mewakili Tanjungpinang untuk berkompetisi menjadi kelurahan terbaik di tingkat Provinsi Kepulauan Riau (Kepri).\r\n\r\nEkspose Evaluasi Perkembangan Kelurahan dilaksanakan di Ballroom Hotel Comfort Tanjungpinang, Rabu (3/4), dan dibuka secaraÂ resmi oleh Walikota Tanjungpinang, H. Lis Darmansyah, SH.\r\n\r\nWalikota Lis Darmansyah, mengatakan ekspose ini sekaligus penilaian terhadap evaluasi perkembangan empat perwakilan kelurahan terpilih dari setiap kecamatan. Hal ini penting dilakukan sebagai alat memotivasi kelurahan agar menjadi lebih baik sekaligus mendorong kelurahan supaya menciptakan inovasi-inovasi di wilayahnya masing-masing, " ucap Lis\r\n\r\nLis mengatakan penilaian evaluasi perkembangan kelurahan 2 tahun terakhir dilakukan pada 3 indikator yaitu bidang pemerintahan kelurahan, kewilayahan, dan kemasyarakatan.Pada proses penilaian kelurahan terbaik, Lis ingin Tanjungpinang punya standar yang berbeda, jangan menang ekspos saja, tetapi harus benar-benar di koreksi, prosesnya harus ada inovasi dan kreatifitas.\r\n\r\n" Dewan juri harus tegas melakukan penilaian, lihat dari grafiknya, bila meningkat berarti kelurahan tersebut berkembang, kalau grafiknya datar, langsung saja di diskualifikasi", tegas Lis\r\n\r\nMenurut Lis, aspek yang perlu menjadi perhatian adalah bidang kemasyarakatan, sebab hal ini mencakup aspek partisipasi masyarakat, pemberdayaan kesejahteraan, pendidikan, kesehatan, ekonomi, dan peningkatan fasilitas masyarakat, karena itu Lurah harus bisa bersinergi dengan perangkat RT/RW, dan masyarakat supaya dalam menyampaikan program kegiatan sesuai dengan fakta di lapangan.\r\n\r\nPemerintah sendiri, sambungnya, sudah merubah pola mustenbang, yaitu dengan mengangarkan Rp. 60 miliar di setiap Kecamatan yang diperuntukan bagi setiap kelurahan, jadi, ketika ada kebutuhan warga yang mendesak, tak perlu lagi menunggu APBD," ujarnya\r\n\r\nSelain itu, Lurah, RT/RW harus tahu perkembangan di wilayahnya, warganya, san sebaginya, karena itu, Lis menyarankan agar setiap aparatur kelurahan, RT/RW harus punya buku saku untuk mencatat segala permalasahan yang terjadi di wilayahnya.\r\nKarena itu, Lis minta kepada Lurah-lurah untuk belajar berinovasi, bersinergilah dengan RT/RW dan masyarakat, dengan begitu bisa menciptakan inovasi-inovasi baru di wilayahnya, sehingga akan lahir Tanjungpinang yang cemerlang," harap Lis\r\n\r\nKepala Dinas Pemberdayaan Perempuan, Perlindungan Anak dan Pemberdayaan Masyarakat, Ahmad Yani, menjelaskan evaluasi perkembangan kelurahan menghasilkan 3 kategori kelurahan, yaitu kelurahan cepat berkembang, kelurahan berkembang dan keluraham kurang berkembang.Â \r\n\r\nKelurahan yang mengikuti lomba merupakan kelurahan dengan kategori cepat berkembang. Dari 18 kelurahan se Kota Tanjungpinang, empat kelurahan yang maju mewakili kecamatan untuk melakukan ekspos yaitu Kecamatan Tanjungpinang Barat diwakili Kelurahan Tanjungpinang Barat.\r\n\r\nKecamatan Tanjungpinang Timur diwakili Kelurahan Melayu Kota Piring, Kecamatan Kota diwakili Kelurahan Senggarang, dan Kecamatan Bukit Bestari diwakili Kelurahan Seijang." terangnya.\r\n\r\nBagi kelurahan yang menang tingkat Kota diharapkan menjadi kelurahan terbaik di tingkat Provinsi Kepulauan Riau yang akan mewakili kelurahan di Provinsi Kepri pada tingkat regional dan nasional nantinya." Ia menambahkan.\r\n\r\nTim penilaian nantinya akan melakukan peninjauan lapangan pada 4 Mei di masing-masibg lokasi terbaik tingkat Kecamatan. Tim penilai sendiri berasal dari Bappelitbang, Dinas Kesehatan PP dan KB, Dinas PPPA dan PM dan Bagian Tata Pemerintahan Setda Kota Tanjungpinang.\r\n\r\nUntuk diketahui kelurahan se Kota Tanjungpinang dengan kategori cepat berkembang yaitu, Kelurahan Batu 9, Kel. Melayu Kota Piring, Kel. Tanjungpinang Barat, Kel. Air Raja, Kel. Sungai Jang, Kel. Senggarang, Kel. Tanjung Ayun Sakti, Kel. Tanjungpinang Timur, Kel. Tanjung Unggat, Kel. Dompak, Kel. Kampung Bulang, Kel. Pinang Kencana, Kel. Kampung Baru.\r\n\r\nSedangkan Kelurahan berkembang adalah Kel. Penyengat, Kel. Kampung Bugis, Kel. Bukit Cermin, Kel. Kemboja, dan Kel. Tanjungpinang Kota. (Humas Pemko Tanjungpinang).', 0, '2017-05-07', '2017-05-07', '2017-10-03 22:53:03', '1', '1', '1', '170507-Empat Kelurahan Berlomba Merebut Gelar Terbaik', 2),
	(2, '516000000', 2, 1, 'Syahrul Lepas Khafilah Kota Tanjungpinang', 'Humas (Rilis Pers) -Setelah lebih kurang delapan hari lamanya para kafilah Kota Tanjungpinang menjalani pemusatan latihan (training centre) di Sunrise City Hotel, Selasa (02/04) malam, training centre resmi ditutup oleh Wakil Walikota Tanjungpinang H. Syahrul, S.Pd.\r\n\r\nPenutupan training centre ini sekaligus melepas kafilah Kota Tanjungpinang untuk bertanding di Kota Batam dalam pelaksanaan STQ  Tingkat Provinsi Kepulauan Riau yang rangkaian kegiatannya di mulai pada tanggal 04 sampai 09 Mei 2017 mendatang.\r\n\r\nDalam sambutannya, Syahrul menyampaikan ucapan terimakasih dan doa , semoga kafilah MTQ Kota Tanjungpinang selalu dilindungi oleh Allah SWT, untuk mengikuti STQ tingkat Provinsi Kepri tahun 2017 di Batam, dan menjadi perta terbaik. \r\n\r\nSyahrul juga mengingatkan, kepada seluruh hafilah untuk selalu menjaga stamina dan kesehatan, agar bisa tampil prima, dapat mamfaatkan waktu semaksimal mungkin untuk senantiasa berlatih sesuai dengan cabang perlombaan, dan sebagai duta Kota Tanjungpinang merupakan duta terbaik, sehingga harus mampu memberikan yang terbaik untuk daerah sendiri.  \r\n\r\n" Pelaksanaan STQ  7 Tingkat Provinsi kali ini, Kota Tanjungpinang mengirimkan sebanyak 360 kafilah, untuk para opesial dan rambongan dan termasuk khafilah untuk selalu jaga sikap, etika , perbuatan selama pelaksaan kegiatan, " ujarnya \r\n\r\nSyahrul mendoakan semoga duta Kota dapat memberikan hasil terbaik untuk Kota Tanjungpinang, selalu kobarkan semangat agar mampu meraih prestasi, " tutup Syahrul\r\n\r\nSebelumnya Asisten I Pemerintahan Drs. Ahadi melaporkan kegiatan pemusatan latihan peserta MTQ Kota tanjungpinang bertujuan meningkatkan kemampuan dan kualitas seni baca Al-Quran bagi Qori dan Qori\'ah, Hafidz, Mufassir untuk persiapan mengikuti seleksi tilawah qur\'an tingkat provinsi Kepri tahun 2017 di Batam.\r\n\r\nKota Tanjungpinang pada STQ Provinsi Kepri membawa 360 khafilah dengan rincian 16 orang peserta lomba putra/putri, 12 orang peserta lomba kompang, 16 orang official, serta 300 orang panitia, tim kesenian dan tim penggembira.\r\n\r\nDijadwalkan, pelaksanaan STQ Tingkat Provinsi ini akan berlangsung tanggal 04-09 Mei 2017. Rangkaian kegiatan akan diawali wisata 1000 hafidz tanggal 04 Mei, pawai ta’ruf tanggal 05 Mei, pelantikan dewan hakim tanggal 05 Mei, pembukaan bazaar tanggal 05 Mei, dan pembukaan MTQ V Tingkat Provinsi Kepulauan Riau akan dilaksanakan pada malam harinya. Rombongan Kota Tanjungpinang sendiri akan bertolak dari pelabuhan Tanjungpinang pada tanggal 03 Mei.\r\n\r\nPada akhir acara Wakil Walikota secara resmi menutup kegiatan penutupan   pemusatan pelatihan para peserta MTQ Kota Tanjungpinang, sekaligus melepas para kafilah untuk merangkat ke Batam.\r\n\r\nAcara Penutupan Pemusatan pelatihan ini diadiri seluruh OPD Kota Tanjungpinang, Kepala Kementerian Agama Kota Tanjungpinang, beserta Camat dan Lurah Sekota Tanjungpinang.(Humas Pemko Tanjungpinang)', 0, '2017-05-07', '2017-05-07', '2017-10-03 22:53:36', '1', '1', '1', '170507-Syahrul Lepas Khafilah Kota Tanjungpinang', 0),
	(3, '516000000', 2, 3, 'Tanjungpinang Tampilkan Karya Raja Ali Haji', 'HUMAS (Rilis Pers)- Ratusan kafilah Kota Tanjungpinang menyemarakkan pawai taaruf Seleksi Tilawatil Qu\'an (STQ) VII Tingkat Provinsi Kepulauan Riau (Kepri) di Kota Batam, Jum\'at (5/4).\r\n\r\nRangkaian STQ dimulai dengan wisuda Hafidz kamis (4/5) di Dataran Engku Putri Batam Center, dilanjutkan dengan malam taaruf sekaligus menjamu para kafilah dari Kabupaten dan kota yang datang di Kota Batam.\r\nKeesok paginya, tepat pukul 07.30 Wib, rombongan kontingen Kota Tanjungpinang sudah berbaris dilokasi star pawai taaruf tepatnya di depan Hotel Alium Nagoya berjalan menuju garis finish di depan martabak Har Nagoya Batam.\r\n\r\nBarisan kontingen Kota Tanjungpinang dimulai dengan mobil hias, barisan drumband diikuti barisan Organisasi Perangkat Daerah (OPD). Tampak pada barisan itu Wakil Walikota Tanjungpinang, H. Syahrul, S. Pd, sementara Walikota Tanjungpinang, H. Lis Darmansyah, SH menunggu di panggung utama untuk menyambut barisan pawai taaruf STQ VII Provinsi Kepri.\r\n\r\nMengangkat tema " Melalui Sileksi Tilawatil Qur\'an, Kita Amalkan Nilai Kandungan Al-Qur\'an dalam Kehidupan Sehari-hari ". Nuansa Islami terlihat pada barisan pawai taaruf, seluruh peserta mengenakan pakaian muslim, mereka ada yang membawa Al-Qur\'an, bendera LPTQ, karya-karya Raja Ali Haji dan ornamen Al-Qur\'an. \r\n\r\nSelain itu, peserta juga ada yang mengenakan pakaian bak pahlawan Melayu Raja Ali Haji dan cendikiawan muslim. Sebagai wujud generasi Qur\'ani, Tanjungpinang menampilkan seorang anak untuk memperagakan khataman Al-Quran sekaligus prosesi tepuk tepung tawar.\r\n\r\nLebih kurang 557 orang peserta Kota Tanjungpinang ikut meriahkan pawai taaruf STQ VII Provinsi Kepri. Untuk pelantikan dewan hakim akan dilaksanakan pada pukul 13.30 Wib di Ballroom Hotel Haris Batam Center, selanjutnya jam 15.30 Wib akan dibuka pameran dan bazar STQ di Dataran Engku Putri Batam Center. Pada malamnya jam 19.30 Wib akan di buka STQ VII Tingkat Provinsi Kepri.(Humas Pemko Tanjungpinang)', 0, '2017-05-07', '2017-05-07', '2017-10-03 22:53:59', '1', '1', '1', '170507-Tanjungpinang Tampilkan Karya Raja Ali Haji', 0),
	(4, '516000000', 2, 6, 'Lis : Pasar Bukan Milik Calo dan Makelar', 'HUMAS (Rilis Pers)- Pasca musibah kebakaran pasar KUD Tanjungpinang 2013 silam, kini pasar tersebut sudah dibangun kembali oleh Pemerintah Kota Tanjungpinang melalui bantuan dana dari Kementerian Perdagangan RI. \r\n\r\nSenin (8/5) pagi tadi, bangunan Pasar Baru KUD diresmikan operasionalnya oleh Walikota Tanjungpinang, H. Lis Darmansyah, SH yang dihadiri Wakil Walikota, H. Syahrul, S. Pd, para Asisten, Staf Ahli, jajaran Kepala OPD, Perbankan, Dirut BUMD, serta para pedagang.\r\n\r\nWalikota Lis Darmansyah, SH, mengatakan pasar merupakan sarana utama untuk memenuhi kebutuhan masyarakat yang harus kita perhatikan, ini juga menyangkut geliat ekonomi pedagang kecil. Pasca musibah kebakaran yang lalu, pembangunan pasar baru ini telah melalui beberapa proses, karena itu, musibah tersebut hendaknya kita jadikan sebagai pembelajaran. \r\n\r\n" Setelah berdirinya bangunan pasar ini, sistem pengelolaannya perlu ditata dengan baik, tidak ada lagi yang sembraut dan kotor, kalau bisa lantainya harus tetap kering, karena pasar tradisional ini bisa dijadikan sebagai destinasi wisata belanja di Tanjungpinang, " kata Lis pada acara itu.\r\n\r\nPembangunan pasar ini, kata Lis, pemko Tanjungpinang menerima bantuan dari Kementerian Perdagangan RI, awalnya pemerintah pusat menggarkan Rp. 7 miliar, karena defisit maka kita mendapat bantuan Rp. 5,2 miliar. Gedung pasar yang dibangun melalui anggaran APBN ini, belum diserah terima oleh Pemerintah Pusat kepada Pemko, namun kita ingin segera difungsikan oleh para pedagang, mengingat ekonomi pasar lama harus terus bergerak.\r\n\r\nMeski Tanjungpinang memiliki 3 zona sektor ekonomi, yaitu pasar kota lama, batu 5 hingga batu 8, dan pasar bintan center, namun kita juga harus memikirkan pergerakkan ekonomi secara merata di Tanjungpinang guna memenuhi kebutuhan masyarakat.\r\n\r\nTahun ini, Lis sendiri akan bertemu langsung dengan Menteri perdagangan untuk membicarakan membuka pasar baru di Tanjungpinang, InsyAllah kita akan mendapatkan pasar baru lagi, namun sistem perencanaannya dari mereka," ujarnya\r\n\r\nNantinya, pasar ini akan di kelola oleh BUMD, bagaimana sistemnya, sarana dan prasarana yang layak, kontrol harga hingga ketersediaan barang di pasaran. Meski sejatinya BUMD merupakan perusahaan yang mencari profit/keuntungan, BUMD harus konsisten dan konsekwen bantu masyarakat. Koordinasikan segala sesuatu dengan dinas terkait." pungkasnya\r\n\r\nSebagai lembaga yang punya kewenangan di pasar, BUMD harus tegas, yang namanya kerja pasti ada resikonya, bekerjalah sesuai aturan dan protapnya, yang tidak benar segera ditindak, pasar itu tidak ada geng-gengan dan preman-premannya, kita semua sama di mata hukum.\r\n\r\n" Tidak ada lagi jagoan dan penguasa di pasar. Pasar ini bukan untuk calo, makelar atau sejenisnya, bila melanggar kita tertibkan sesuai aturan, ambil kebijakan sesuai hukum yang belaku, jangan tunggu intruksi, beri teguran secara tertulis, bila tidak diindahkan ambil jalur lain, pasar bukan tempat preman tetapi tempat orang berdagang, mekanismenya harus diatur, biar akses pasar aman, nyaman dan pedagang dilindungi, BUMD bisa minta bantuan Satpol PP untuk menertibkan itu ", tegas Lis, ketika melihat bagunan pasar yang berdiri tanpa izin.\r\n\r\nSaya tak mau lagi mendengar ada keluhan dari para pedagang terkait kios-kios, kios ini harus digunakan oleh si penyewa, bukannya di sewakan lagi ke orang lain, bila kedapatan kita hentikan sewanya. Selain itu, demi kenyamanan masyarakat yang berbelanja, pasar Jalan Gambir harus bersih, tidak ada lagi orang berjualan dipinggir jalan, jadi aksesnya tidak sempit dan berdesakan. Nanti kita akan memanggil para pedagang untuk mendiskusikan hal ini guna mencari solusi dan jalan keluarnya.\r\n\r\n" Saya ingin masyarakat itu merasakan bahwa pemerintah ada, mereka merasa dilindungi dan diperhatikan pemerintah, sehingga pasar ini mampu memberi pelayanan yang terbaik, dan ingatlah untuk menjaga kebersihan dan kenyamanan pasar ini, jangan hanya mudah untuk membangun tetapi sulit untuk menjaga", ucapnya\r\n\r\nKepala Dinas Perdagangan dan Perindustrian Kota Tanjungpinang, Drs. Juramadi Esram mengatakan bahwa pembangunan pasar baru ini sudah dimulai sejak kepemimpinan bapak Suyatno, dan saya sendiri melanjutkan apa yang sudah diperjuangkan beliau.\r\n\r\nPasar ini sudah sangat dinanti-nanti oleh para pedagang, karena itu, meski belum dihibahkan oleh pemerintah pusat kepada kami, pasar ini kita resmikan dan fungsikan, namun sebelumnya kita sudah melakukan koordinasi dengan Kementertian Perdagangan agar segera digunakan, mereka pun tak ingin bangunan ini rusak jika kelamaan kosong." ucapnya\r\n\r\nDia menjelaskan, sebelum resmi diserahkan ke pemerintah kota Tanjungpinang, para pedagang tidak dimintai retribusi, pemerintah memberi bonus retribusi kepada para pedagang, namun pembayaran seperti listrik, air, dan kebersihan perlu dibayar. Mudah-mudahan Juni nanti, pasar ini sudah diserahkan pemerintah pusat kepada pemko Tanjungpinang, setelah mendapat persetujuan dari Menteri perdagangan, akan kita kenakan retribusi untuk pendapatan asli daerah. Untuk pelaksanaannya pasar ini, di Dinas Perdagangan dan Perindustrian, tetapi operasionalnya nanti kita serahkan ke BUMD.\r\n\r\nAda 30 kios dan 9 meja loss yang tersedia bagi para pedagang. Dia berharap, para pedagang bisa menjaga kebersihan pasar ini, karena selain sebagai tempat jual beli, pasar ini bisa menjadi wisata belanja bagi wisatawan yang berkunjung ke Tanjungpinang," katanya\r\n\r\nSetelah memberi sambutan, Lis dan Syahrul meninjau kios-kios. Lis juga menuliskan pesan diatas kanvas putih yang berbunyi" Ekonomi merupakan kebutuhan penting dalam kehidupan. Pasar salah satu bagian dari kebutuhan tersebut dalam memenuhi hajat dimaksud. Selamat atas peresmian pasar, semoga bermanfaat bagi masyarakat".\r\n\r\nKetika menyusuri pasar, Lis terlihat bertemu dengan beberapa pedagang dan mendengarkan keluhan mereka, Lis pun menanggapi keluhan mereka dengan bijaksanan. Seusai meresmikan pasar baru, Lis langsung menuju ke pasar Bintan Center untuk meresmikan mesin es kapasitas 2 ton yang bersumber dari dana APBN. (Humas Pemko Tanjungpinang)', 0, '2017-05-08', '2017-05-08', '2017-10-03 22:54:25', '1', '1', '1', '170508', 10),
	(5, '516000000', 2, 7, 'SMP N 1 dan Gugus 01 SD Tanjungpinang Timur Juara Umum O2SN', 'Humas (Rilis Pers) Dinas Pemuda dan Olahraga (Dispora) Kota Tanjungpinang menutup Olimpiade Olahraga Siswa Nasional (O2SN), sekaligus melepas kontingen O2SN Tahun 2017 ke tingkat Provinsi Kepri.\r\n\r\nO2SN tahun 2017 ini, membawa SMPN 01 dan SD gugus 01 Tanjungpinang Timur juara umum pada tingkat Kota Tanjungpinang, yang resmi ditutup oleh Walikota Tanjungpinang, Lis Darmansyah di Aula Bulang Linggi Gedung Arsip Kota Tanjungping, Minggu (7/5).\r\n\r\n"Kepada seluruh pelajar yang telah mengikuti perlombaan, agar dapat meningkatkan lagi kemampuan, karena perjuang untuk mencapai prestasi baru ditingkat lokal, saatnya untuk meraih ditingkat provinsi dan nasional, " Tutur Walikota Tanjungpinang saat sambutan\r\n\r\n" kunci keberhasilan adalah kedisiplinan diri, berjuang untuk sukses butuh disiplin, selain itu juga kepada peserta harus taat aturan, baik itu aturan pelatih maupun orang tua,"Tuturnya \r\n\r\n"Jangan biasakan diri untuk bermain diluar kontrol, contohnya bermain warnet, maupun main hp sampai larut malam, karena jika ingin berprestasi baik di bidang akademik dan non akademik harus memiliki sikap disiplin, taat pada aturan dan selalu minta doa kepada orang tua" pesan Walikota Tanjungpinang, Lis Darmansyah.\r\n\r\nLanjutnya, terlaksananya kegiatan O2SN ini harus dapat mempupuk semangat para peserta, sehingga para peserta memiliki kepercayaan diri untuk membagun prestasi, sehingga untuk sekolah- sekolah harus memberikan penghargaan kepada siswa-siswi yang meraih juara di O2SN\r\n\r\n" kompetensi O2SN telah mendapatkan bibit-bibit yang terbaik untuk mewakili Tanjungpinang di ajang O2SN tingkat provinsi maupun nasional, sehingga saya harapkan koordinasi, bimbingan ortua dan sekolah dapat mensuport para peserta untuk mengapai prestasinya," tambahny\r\n\r\n“Karena tantangan dalam kompetisi O2SN di tingkat provinsi akan semakin berat, atlet-atlet kita akan bersaing dengan atlet dari daerah lain yang memiliki potensi yang lebih unggul. Namun jangan sampai anak -anak peserta O2SN dari Tanjungpinang terpecah mental dan pikiranya untuk mengikuti O2SN tingkat provinsi, sehingga kepada kepala sekolah dan guru agar terus mendukung dan mensupport anak didik untuk mengembangkan bakat dan minat yang dimiliki, agar mampu bersaing dan mengukir prestasi membanggakan baik dalam bidang akademik dan non akademik,” katanya.\r\n\r\nUntuk Pemerintah daerah, yakni Dinas Pemuda Olahraga terus melakukan evalusi dan memperbaiki apa yang menjadi kekurang, baik  pelaksaannya maupun hadiahnya," tutup Lis\r\n\r\nSebelumnya Kepala Dinas Pemuda dan Olah Raga menyampaikan O2SN telah berlangsung mulai 25 hingga 30 April 2017 dengan cabang olahraga yang diperlombakan terdiri dari cabang atletik, olahraga silat, karate, renang, tenis meja, badminton, dan volly ball untuk tingkat SD dan SMP. " Kepada peserta pemenang akan mendapat piagam, uang pembinaan dan untuk juara umum akan mendapatkan 5 juta rupiah, sedangkan jumlah sekolah yang mengikuti sebanyak 75 sekolah terdiri dari pelajar SD berjumlah 15 klub dan SMP sebanyak 30 sekolah di Kota Tanjungpinang." Ungkapnya\r\n\r\n" O2SN telah dapat  mencari bibit siswa-siswi SD maupun SMP untuk mengikuti ketingkat provinsi, semoga peserta kita dapat membawa nama baik sekolah maupun Kota Tanjungpinang, " tutupnya\r\n\r\nPeserta O2SN Kota Tanjungpinang dilepas oleh Walikota Tanjungpinang didampingi Kepala Dinas Pemuda dan Olah Raga Gunawan Grounimo, jajaran Kepala OPD, Camat, Lurah, kepala sekolah serta guru olahraga tingkat SD dan SMP.(Humas Pemko Tanjungpinang)', 0, '2017-05-08', '2017-05-08', '2017-10-03 22:54:45', '1', '1', '1', '170508-SMP N 1 dan Gugus 01 SD', 4),
	(6, '516000000', 2, 7, 'Ribuan Pelajar Meriahkan Gebyar Hardiknas 2017', 'UMAS (Rilis Pers)- Dalam rangka memperingati Hari Pendidikan Nasional (Hardiknas) 2017, Dinas Pendidikan Kota Tanjungpinang mengadakan Gebyar Hardiknas di Pelataran Taman Laman Boenda Tepi Laut Tanjungpinang, Rabu (10/5).\r\n\r\nAcara ini dimeriahkan beragam kegiatan dan ribuan peserta didik dari Taman Kanak-kanak (TK), siswa-siswi Sekolah Dasar (SD), SMP, SMA/SMK di Kota Tanjungpinang.\r\n\r\nRangkaian acara dimulai dengan senam ceria yang diikuti sebanyak 3.500 anak PAUD dan senam tarian alam yang diperagakan oleh 1000 pelajar SD dan SMP di Kota Kota Tanjungpinang. \r\n\r\nTampak Lis ikut senam bersama anak-anak, mereka terlihat gembira mengikuti setiap gerakan senam yang di pandu oleh ibu guru. Lis memang seorang pemimpin yang sayang dengan anak-anak, hal ini terlihat ketika anak-anak meminta gendong kepadanya, ia pun langsung memenuhi keinginan mereka, anak-anak lain yang melihat juga ingin digendong dengan orang  nomor satu di Tanjungpinang, sesekali Lis juga menghibur anak-anak dengan candaannya.\r\n\r\nWalikota Tanjungpinang, H. Lis Darmansyah, SH, memberi apresiasi kepada Dinas Pendidikan yang mampu melaksanakan pendidikan sekaligus memberi motivasi bagi anak-anak dalam meraih prestasi bagi pendidikan kita.\r\n\r\nRangkaian demi rangkaian kegiatan yang dilaksanakan hari ini merupakan salah satu upaya untuk menunjukkan kreatifitas anak didik kita berkontribusi dalam hardiknas tahun ini.\r\n\r\nSelain itu, beragam kegiatan yang diikuti oleh anak-anak kita mulai dari TK, SD, SMP, SMA dan SMK ini mencerminkan sinergitas dunia pendidikan dalam meningkatkan pendidikan di Kota Tanjungpinang." ujar Lis saat memberi sambutan pada acara Hardiknas.\r\n\r\nDia mengatakan, jumlah anak-anak hanya 30 persen dari kita tetapi 100 persen bagi masa depan bangsa ini. Kedepan merekalah yang akan menjadi pemimpin-pemimpin masa depan bangsa ini. \r\n\r\nUntuk itulah, mari kita kembangkan dan lakukan pembinaan leadership pada generasi kita, bentuk pertumbuhan karakter mereka yang berakhlak mulia, sifat dan sikap yang baik, karena sifat dan sikap mulia harus kita tanamkan sejak dini kepada cikal bakal masa depan bangsa ini.\r\n\r\nLis berharap, melalui kegiatan ini ada sesuatu yang bisa kita ambil maknanya agar Tanjungpinang benar-benar menjadi Kota pendidikan dan dunia anak-anak, " Mudah-mudahan rangkaian hardiknas ini mampu menjawab tantangan masa depan kitq, semoga dengan semangat hardiknas, pendidikan Kota Tanjungpinang lebih baik, maju serta lebih berkualitas ", ujarnya\r\n\r\nKepala Dinas Pendidikan Kota Tanjungpinang, Drs. HZ Dadang AG, mengatakan belum lama ini, anak-anak SMP kelas 9 dan SMA/SMK kelas 12 baru selesai melaksanakan ujian nasional dan minggu akan datang anak-anak SD yang akan melaksanakan ujian nasional, disela-sela inilah kita ini kita tmpilkan kreatifitas anak-anak TK, SD, SMP, SMA dan SMK se Kota Tanjungpinang.\r\n\r\nKegiatan Hardiknas yang kita kemas dalam Gebyar hardiknas 2017 ini dimeriahkan dengan beragam kegiatan yang diikuti peserta didik maupun satuan pendidikan mulai dari PAUD, TK, SD, SMP, SMA, SMK, hingga pendidikan no formal dan lembaga kursus.\r\n\r\nBeragam kegiatan tersebut diantaranya, pameran promosi prestasi pendidikan sebanyak 19 stand pameran dimulai sejak 10-13 Mei pada malam hari, selanjutnya akan ada lomba kreatifitas siswa yang dikemas dalam festival lomba seni nasional yang diikuti 18 sekolah tingkat SD dan 13 SMA, lomba pidato, lomba membaca gurindam 12, drumband cilik, mewarnai, menggambar, lomba pecah balon dan lainnya. Tak hanya anak-anak dan pelajar, khusus guru-guru PAUD akan ikut pada lomba cipta dan baca puisi, " terangnya.\r\n\r\nSeusai membuka kegiatan tersebut, Walikota beserta Istri Ibu Hj. Yuniarni Pustoko Weni, SH, meninjau stand-stand pameran. Beragam hasil kreatifitas siswa-siswi yang dipamerkan pada stand bazar ini. Lis pun terlihat membeli hasil karya pelajar. \r\n\r\nAcara turut dihadiri, jajaran Kepala OPD, Ketua Dewan Pendidikan Kota Tanjungpinang, Zamzami A Karim, para Guru, pengawas sekolah, orang tua murid serta ribuan siswa-siswi se Kota Tanjungpinang.(Humas Pemko Tanjungpinang)', 0, '2017-05-10', '2017-05-10', '2017-10-03 22:55:05', '1', '1', '1', '170510-Ribuan Pelajar Meriahkan Gebyar Hardiknas 2017', 0),
	(7, '516000000', 2, 4, 'Tanjungpinang Juara Umum II STQ VII Provinsi Kepri', 'HUMAS (Rilis Pers)- Kota Tanjungpinang berhasil menyabet juara umum II pada Seleksi Tilawatil Qur\'an VII Tingkat Provinsi Kepulauan Riau (Kepri) yang berlangsung di Kota Batam sejak 5 hingga 9 Mei 2017.\r\n\r\nTahun ini, setelah unjuk kebolehan di ajang STQ VII Provinsi Kepri, kafilah Tanjungpinang mampu mengalahkan Kota Batam, mereka pulang ke Tanjungpinang dengan memboyong piala dan sejumlah prestasi.\r\n\r\nPada perhelatan syiar agama ini, Kota Tanjungpinang mengirim sebanyak 16 kafilah. Diantaranya berhasil menoreh prestasi juara 1 terbaik hahfidz Quran golongan anak dan dewasa putri, juara 3 tilawah Al Qur\'an, juara 2 putra dan 3 putri hifzil Qur\'an 1 Juz Tilawah, juara 1 putra dan 2 putri golongan 5 Juz, juara 1 putra dan 3 putri 10 Juz.\r\n\r\nUntuk golongan 20 Juz juara 2 puta dan juara 2 putri, 30 juz juara 1 putra dan juara 3 putri, sedangkan tafis Quran bahasa arab juara 3 putra dan 1 putri, ditambah dengan juara 3 pawai taaruf, juara 3 qasidah rabana, dan juara harapan stand bazar.\r\n\r\nKepulangan para kafilah ke Tanjungpinang pun disambut langsung oleh Pemerintah Kota Tanjungpinang Rabu (10/5) di Pelabuhan Sri Bintan Pura (SBP).\r\n\r\nKedatangan para kafilah dipimpin oleh Wakil Walikota H. Syahrul, S. Pd, Asisten, Staf Ahli, jajaran Kepala OPD, serta sejumlah pengurus LPTQ Kota Tanjungpinang.\r\n\r\nSetibanya di Pelabuhan SBP, kafilah langsung disambut dengan kompang dan Wawako menerima pengalungan rangkaian bunga dari Walikota Tanjungpinang, H. Lis Darmansyah, SH. Lis pun langsung menyalami para kafilah yang tiba.\r\n\r\nWajah gembira terlihat dari raut wajah Lis-Syahrul, mereka pun secara kompak menjawab pertanyaan yang diajukan awak media saat hendak keluar pintu pelabuhan.\r\n\r\n" Alhamdulillah, Tanjungpinang bisa meningkatkan prestasi juara umum 2 STQ Provinsi Kepri. Ini berkat kerja keras bapak Wawako selaku LPTQ serta masyarakat dan semua pihak yang terlibat ", ucap Lis\r\n\r\nLis berujar, untuk mempertahankan prestasi ini, kita selalu melakukan evaluasi setiap pelaksanaan MTQ, baik tingkat kelurahan maupun Provinsi Kepri. Bila kita lihat dengan pelaksanaan MTQ di tingkat Kelurahan, ternyata potensi anak lokalnya luar biasa, mereka pun banyak ikut pada ajang STQ ini.\r\n\r\nPemko Tanjungpinang akan terus berupaya untuk mendorong dan memotivasi qori dan qoriah Tanjungpinang, salah satunya dengan mendirikan pusat pendidikan agama di Pulau Penyengat, mudah-mudahan ini memberi semangat bagi mereka, " harap Lis\r\n\r\n" Alhamdulillah setelah penantian panjang dan segala upaya akhirnya Tanjungpinang pada STQ VII tingkat Provinsi Kepri bisa menjadi juara II, setelah sebelumnya Tanjungpinang selalu menduduki peringat ke 3, prestasi ini tentu, berkat sinergitas kita bersama serta doa dari seluruh elemen masyarakat Tanjungpinang ", kata Syahrul selaku Ketua LPTQ, seusai penyambutan di pelabuhan SBP.\r\n\r\nIa mengatakan, Tanjungpinang merupakan satu-satunya Kota yang melaksanakan MTQ di tingkat Kelurahan. Kedepan MTQ akan semakin beeat, dan ini menjadi tangunggjawab berat bagi kita semua untuk berupaya semaksimal mungkin dan bekerja keras mempertahankan juara, karena mempertahankan gelar juara lebih sulit ketimbang meraihnya." tutur Syahrul\r\n" Semoga prestasi ini bisa terus meningkat dan dipertahankan pada setiap cabang lomba yang diikuti oleh kafilah Kota Tanjungpinang ", ucap Lis dan Syahrul serentak\r\n\r\nPada malam penutupan STQ, dewan juri mengumumkan dari tujuh Kabupaten/Kota se Provinsi Kepri, Kota Tanjungpinang berhasil menduduki juara II, sedangkan juara I masih diraih Kabupaten Karimun.\r\n\r\nTahun 2016 lalu, Kota Batam meraih juara umum II dan tahun 2017 Tanjungpinang mampu menempati posisi kota Batam. Kota Batam sendiri meraih juara III, Kabupaten Bintan juara harapan, sementara posisi ke 5 Lingga, Natuna di nomor 6, dan terakhir Kabupaten Anambas.(Humas Pemko Tanjungpinang)', 0, '2017-05-10', '2017-05-10', '2017-10-03 22:55:28', '1', '1', '1', '170510-Tanjungpinang Juara Umum II STQ VII Provinsi Kepri', 3),
	(8, '516000000', 2, 1, '18 Pesonel PKB/PLKB Kota Tanjungpinang Menjadi Pegawai BKKBN Pusa', 'HUMAS Pemko Tanjungpinang- Walikota Tanjungpinang, H. Lis Darmansyah, SH menandatangani Berita Acara Serah Terima (BAST) Penyuluh Keluarga Berencana (PKB) dan Petugas Lapangan Keluarga Berencana (PLKB) Kota Tanjungpinang ke BKKBN Pusat.\r\n\r\nPenandatangan itu dilakukan Walikota bersama Sekretaris Utama BKKBN RI, Nofrizal, SPMA dengan pejabat Kabupaten/Kota se-Provinsi Kepri yang berlangsung di Ballroom Hotel CK Tanjungpinang, Senin (31/7) pagi tadi.\r\n\r\nProsesi penandatanganan dan penyerahan SK Pokja disaksikan oleh Ketua DPRD Provinsi Kepri, Asisten III Pemrov Kepri, Ketua DPRD Kota Tanjungpinang, Asisten I Pemko Tanjungpinang, Kepala Dinas P3A dan Penmas, Kepala BPK SDM, Kepala Dinas Kesehatan PP dan KB Kota Tanjungpinang, serta sejumlah pejabat Kabupaten dan Kota se-Provinsi Kepri.\r\n\r\nSekretaris Utama BKKBN RI, Nofrizal, SPMA mengatakan proses penandatanganan berita acara serah terima PKB dan PLKB dilakukan secara nasional. Sebanyak 15.458 personel penyuluh dan petugas KB di seluruh pemerintah daerah dialihkan menjadi pegawai BKKBN pusat. \r\n\r\nDia menjelaskan, sebelum melaksanakan tugas di BKKBN sebelum 1 Januari 2018, segala hak-hak PKB/PLKB, baik itu keuangan maupun kepegawaian masih menjadi kewajiban Pemerintah Daerah sampai dengan 31 Desember 2017 dan akan beralih ke BKKBN TMT 1 Januari 2018. \r\n\r\nNofrizal berharap seluruh personel PKB dan PLKB di seluruh nusantara bisa tetap menjalankan prograk kependudukan yang selama ini sudah berjalan guna meningkatkan kualitas anak bangsa," pungkasnya.\r\n\r\nUntuk Kota Tanjungpinang sebanyak 18 orang petugas PKB dan PLKB menjadi pegawai BKKBN pusat.\r\n\r\nSeusai penandatanganan BAST, acara dilanjutkan dengan Rapat Penelaahan Program Kependudukan, Keluarga Berencana Pembangunan Keluarga (KKBKP). Sebelum melanjutkan agenda kerjanya, Walikota menemui personel PKB/PLKB untuk berbincang-bincan santai dan menyalami mereka.(Humas)', 0, '2017-07-31', '2017-07-31', '2017-10-03 22:55:58', '1', '1', '1', '170731-18Personel PKB PLKB', 0),
	(9, '516000000', 2, 1, 'Pemko dan KPUD Tanjungpinang Teken Naskah Perjanjian Hibah Daerah', 'HUMAS Pemko Tanjungpinang- Pemerintah Kota Tanjungpinang dan Komisi Pemilihan Umum  Daerah (KPUD) Tanjungpinang melakukan penandatanganan Naskah Perjanjian Hibah Daerah (NPHD), di Aula Kantor Walikota Tanjungpinang, Senggarang, Senin (31/7). \r\n\r\nPenandatanganan tersebut dilakukan dalam rangka untuk menghadapi Pilkada tahun 2018 mendatang.\r\n\r\nWalikota Tanjungpinang, H. Lis Darmansyah, SH, mengatakan NPHD merupakan kesepakatan bersama antara Pemerintah Kota Tanjungpinang dengan KPUD Kota Tanjungpinang atas pendanaan Pemilukada Walikota dan Wakil Walikota Tanjungpinang tahun 2018," ujarnya\r\n\r\nWalikota menyebutkan, besaran NPHD yang telah disepakati yaitu Rp.16.866.462.000 yang dibagi dalam tiga tahap pencairan. Untuk tahap 1 berjumlah Rp. 5,4M, tahap II berjumlah Rp.3,6M dan tahap III berjumlah 7,86M. \r\n\r\n" Perjanjian ini merupakan suatu komitmen pemerintah kota Tanjungpinang agar pelaksanaan pemilihan Walikota dan Wakil Walikota berjalan aman, tertib, dan damai ", ucapnya\r\n\r\nDengan telah ditandatangani NPHD itu, Walikota berharap KPUD dapat melaksanakan tugasnya sesuai dengan tahapan yang telah dicanangkan yang mulai berjalan pada oktober tahun ini.(Humas)', 0, '2017-07-31', '2017-07-31', '2017-10-03 22:56:19', '1', '1', '1', '170731-Pemko dan KPUD Teken Naskah', 1),
	(10, '516000000', 2, 1, 'Fasilitas Forum CSR', 'HUMAS Pemko Tanjungpiang - Pemerintah Kota Tanjungpinang gelar pertemuan dengan para pelaku usaha, BUMN / BUMD Kota Tanjungpinang untuk mensosialisasikan kebijakan CSR yang dikemas dalam kegiatan Fasilitasi Forum CSR / Program Kemitraan dan Bina Lingkungan.\r\n\r\nKegiatan yang di ikuti oleh Pelaku Usaha yang ada di Kota Tanjungpinang dan BUMN / BUMD ini dibuka secara resmi oleh Walikota Tanjungpinang H. Lis Darmansyah, SH di Hotel CK Tanjungpinang, Senin ( 31/7).\r\n\r\nPada saat ini Pemerintah Kota Tanjungpinang sedeng berusaha agar sektor pembangunan dapat bergerak di setiap sisi, sehingga prekonomian juga dapat tumbuh dan berkembang dengan cepat di berbagai sektor yang pada akhirna dapat meningkatkan kesejahtraan masyarakat.\r\n\r\nUntuk mewujudkan semua itu sangat dibutuhkan partisipasi dan kerjasama dari berbagai stakholder agar semua stakeholder terkait dapat bersinergi dalam upaya mewujudkan program-program kerja pemerintah agar dapat segera dapat dinikmati masyarakat.\r\n\r\nOleh karena itu pemerintah kota tanjungpinang menghimbau dan mengajak pelaku usaha, masyarakat, memerinrah untuk secara bersama menyusun merencanakan mengevaluasi serata memonitor bagaimana pelaksanaan CSR dilaksanakan perusahaan yang selama ini dan selama ini cenderung perusahaan berjalan sendiri- sendiri dan tidak dilaksanakan secara berkelanjutan.\r\n\r\nOleh karena itu pula Lis mengharapkan dengan pertemuan ini bagi para pelaku usaha yang belum pernah melaksanakan CSR hendaklah menganggarkan bagian dari keuntungannya perusahaannya untuk membantu pemerintah dalam percepatan pertumbuhan pembangunan melalui CSR.\r\n\r\nLis juga sangat berterimakasih sekali kepada perusahaan perusahaan yang selama ini telah berperan aktif membantu pemerimtah Kota Tanjungpinang melalui program CRS nya. Serta program CSR yang ada di setiap prushaan BUMN / BUMD dan. perseroan ini dapat disinergikan dengan program program pemerintah sehingga maksud dan tujuan dari program ini dapat terlaksana sesuai dengan harapan pemerintah dan apa yang menjadi tujuan dan harapan untuk mensejahtrakan masyarakat dapat tercapai.\r\n\r\nDari sekian banyak rencana strategi dan program kerja yang ingin dilakukan pemerintah Kota Tanjungpinang Ada beberapa program yang menjadi prioritas yang dapat di realisasikan pada waktu dekat ini, diantaranya : pengembangan kawasan perdagangan kota lama (sepanjang Jl. Merdeka) denga memberdayakan para pedagang lokal dengan konsep mobile toko (Moko) jumlah yang di rencanakan sebanyak 100 unit dengan target yang di rencanakan pada tahap pertama sebanyak 60 unit.\r\n\r\nPenyerahan secara simbolis Mobile Toko (Moko) dengan Program CSR Kemitraan dan bina lingkungan untuk pengembangan kota lama "Pasar malam Tanjungpinang" oleh : Bank Riau Kepri Cabang Tanjungpinang Sebanyak 20 Unit Moko Melalui Program Bina Lingkunagan, PD. BPR Bestari 10 Unit Melalui Program Kementerian Dan 2 Unit melalui Program Bina Lingkungan, PT. PELINDO I Cabang Tanjungpinang Sebanyak 20 Unit Melalui Program Kemitraan, BRI Cabang Tanjungpinang Sebanyak 20 Unit melalui Program Kemitraan.(Humas)', 0, '2017-08-01', '2017-08-01', '2017-10-03 22:56:40', '1', '1', '1', '170801-Fasilitas Forum CSR', 0),
	(11, '516000000', 2, 1, 'Pencanangan BBGRM dan Hari Kesatuan Gerak PKK Berlangsung Meriah', 'Humas Tanjungpinang - Pemerintah Kota Tanjungpinang melalui Dinas Pemberdayaan Perempuan, Perlindungan Anak dan Pemberdayaan Masyarakat (DP3APM) menyelenggarakan Pencanangan Bulan Bhakti Gotong Royong Masyarakat (BBGRM) ke XIV yang disejalankan dengan Hari Kesatuan Gerak PKK ke - 45 Tingkat Kota Tanjungpinang Tahun 2017 di Lapangan Dewa Ruci, Sabtu (29/7)\r\n\r\nAcara yang dihadiri Walikota dan Wakil Walikota Tanjungpinang ini berlangsung meriah, yang juga dihadiri oleh Ketua DPRD Kota, FKPD Kota, Sekretaris Daerah Kota Drs.Riono,M.Si,  Ketua TP PKK, Ketua GOW, Ketua DWP, Kepala OPD, Lurah se Kota Tanjungpinang, Seluruh Organisasi Wanita, Tokoh Masyarakat, RT RW serta Siswa Siswi SMP dan SMA.\r\n\r\nWalikota Tanjungpinang H.Lis Darmansyah dalam sambutannya mengatakan bahwa tema Dengan semangat Kita Bangun Budaya Gotong Royong Untuk Tanjungpinang yang lebih baik, tentunya bukan hanya dilaksanakan sekedar seremoni saja, namun dapat kita terapkan dalam kehidupan sehari hari dan menjadikan kebiasaan dalam diri kita untuk selalu menjaga kebersihan, dan selalu menjalani kehidupan sosial dalam bermasyarakat," ujar Lis.\r\n\r\nMakna dari Gotong Royong ini harus kita tanamkan sejak dari generasi muda, sehingga harapan untuk mendapatkan generasi penerus bangsa bisa kita dapatkan dengan baik. Sekarang ini jaman sudah canggih, sudah serba digital dan Segala Informasi sudah sangat mudah kita dapatkan, maka dari itu mulai dari Tingkat Kelurahan, Kecamatan hingga OPD seharusnya sudah bisa merencanakan kira kira apa saja yang harus dikerjakan untuk pelaksanaan Bulan Bhakti Gotong Royong ini, agar setiap pelaksanaan dapat terkonsep dan berjalan dengan baik," Walikota menambahkan.\r\n\r\nPada kesempatan ini, Lis menyampaikan Kota Tanjungpinang akan menerima kembali piala adipura ke 12, yang akan diserahkan pada tanggal 2 Agustus mendatang. Maka dari itu mari sama sama kita selalu menjaga kebersihan untuk kenyamanan kita bersama, dan diakhir sambutan nya Lis menyampaikan bahwa tantangan kita kedepan semakin berat, maka dari itu mari kita sama sama membangun kota Tanjungpinang ini, baik Masyarakat maupun perangkat Pemerintah agar lebih baik lagi kedepan nya, tutup Lis.\r\n\r\nDR.H.M. Yani, MM.M.Kes Kepala DP3A PM menyampaikan dalam laporannya bahwa maksud dan tujuan pelaksanaan kegiatan ini adalah untuk menumbuhkan rasa kebersamaan warga Kota Tanjungpinang,khususnya dalam penanganan sampah dan agar terciptanya lingkungan yang bersih dari sampah serta demi terjaganya ekosistem yang ada dikingkungan kita," ucapnya\r\n\r\nKetua TP PKK Kota Tanjungpinang Hj.Yuniarni P. Weni, SH juga menyampaikan pesan dalam sambutan nya sempena Peringatan Hari Kesatuan Gerak PKK ke 45, bahwa kita sebagai Anggota PKK harus bekerja dengan rendah hati, jalankan prinsip kemitraan, dan jangan menganggap wajar pada suatu kesalahan, karena suatu kesalahan harus dievaluasi dan dijadikan pelajaran agar dapat lebih baik lagi," kata Weni.\r\n\r\nWeni juga menginginkan agar seluruh jajaran PKK betul betul bisa melaksanakan 10 program pokok PKK yang didalamnya ada program prioritas, Program unggulan dan bahkan Program spesifik Daerah sesuai dengan kebijakan Pemerintah Daerah.\r\n\r\nDiakhir sambutannya, Weni juga mengucapkan selamat kepada PKK Kota Tanjungpinang yang telah memenangkan Juara 1 pada lomba memasak menu ikan kategori kudapan Tingkat Provinsi dan juga mengucapkan selamat kepada Pemerintah Kota Tanjungpinang atas prestasi dan penghargaan yang sudah banyak diterima dari Pemerintah Pusat di Tahun 2017 ini diantaranya Wahana Tata Nugraha, Lakip terbaik 4 se Indonesia, dan terbaik pertama diLuar Jawa, Kota Layak Anak tingkat Pratama, TPID Terbaik se Indonesia, Yokatta Golden Award, serta akan kembali menerima Piala Adipura tahun 2017. Semoga kerjasama antara Masyarakat dan Pemerintah tetap berjalan dengan baik," tutup Weni.\r\n\r\nAcara juga diselingi hiburan tari zapin yang disuguhkan oleh 65 orang kader PKK se Kota Tanjungpinang, serta ditutup dengan penyerahan hadiah bagi pemenang lomba dalam rangka HKG PKK, dan Lomba Inovasi Tekhnologi Tepat Guna tahun 2017, diakhiri dengan pemotongan tumpeng dan foto bersama.(Humas)', 0, '2017-08-01', '2017-08-01', '2017-10-03 22:57:00', '1', '1', '1', '170801-Pencanangan BBGRM', 0),
	(12, '516000000', 2, 1, 'Wakil Walikota Ayo Bawa Balita ke Posyandu', 'HUMAS Pemko Tanjungpinang- Ratusan ibu-ibu berbondong-bondong membawa Balitanya untuk ikut dalam acara Lomba Balita Sehat (LBS) Tingkat Kota Tanjungpinang Tahun 2017. \r\n\r\nSebanyak 100 balita menjadi peserta pada LBS yang diadakan oleh Dinas Kesehatan Pengendalian Penduduk dan Keluarga Berencana Kota Tanjungpinang.\r\n\r\nAcara yang dipusatkan di Aula Bulang Linggi Dinas Perpustakaan dan Arsip Daerah Kota Tanjungpinang dibuka secara resmi oleh Wakil Walikota, H. Syahrul, S. Pd, Selasa (1/8).\r\n\r\nSebelum membuka acara tersebut, Mantan Guru SD ini mampu menciptakan suasana gembira dan ceria. Ia mengajak seluruh ibu-ibu dan tamu undangan untuk menyanyi Lagu Bunda Tiara bersama-bersama. Sontak saja suara nyanyian itu semakin nyaring terdengar di ruangan.\r\n\r\n" Bila kita hayati lagu ini begitu sedih. Sebuah lagu bisa mempengaruhi karakter anak. Saat ini lagu tersebut sudah jarang sekali di nyanyikan ibu-ibu untuk anaknya, padahal lagu ini punya makna untuk membentuk karakter anak kita ", ujar Wakil Walikota\r\n\r\nDikatakan Wakil Walikota, H. Syahrul pembangunan kesehatan dan tumbuh kembang anak perlu dilakukan sedini mungkin, mulai dari anak didalam kandungan sampai lima tahun pertama kehidupannya.\r\n\r\nWakil Walikota menjelaskan, saat ini jumlah balita di Kota Tanjungpinang sebanyak 21.926 dari jumlah penduduk dan jumlah orang dewasa berjumlah 254.467 jiwa. Untuk memperoleh balita sehat sebagai penerus bangsa, maka perlu perhatian serius terhadap pertumbuhan dan perkembangan balita. \r\n\r\nDari jumlah balita tersebut, balita yang dilakukan deteksi dini tumbuh kembang di Posyandu TK dan Paud pada tahun 2016 sebesar 15.331 balita dari sasaran dari jumlah tersebut 47 orang mengalami penyimpangan tumbuh kembang. \r\nUntuk itu, upaya yang dilakukan saat ini bagi balita tersebut adalah dengan pembinaan secara komprehensif dan berkesinambungan termasuk pembinaan kesehatannya, tidak bisa dilakukan setengah-setengah tetapi harus dilakukan secara terkoordinasi dan berkelanjutan. Sehingga generasi penerus ini dapat tumbuh dan berkembang secara optimal," ucap Wakil Walikota.\r\n\r\nUpaya lain untuk memperolehi balita sehat melalui pemantauan pertumbuhan di Posyandu. Saat ini jumlah Posyandu yang tersebar di wilayah Kota Tanjungpinang sebanyak 134. Pemantauan perkembangan juga dapat diperoleh di Posyandu, TK dan Paud melalui kegiatan stimulasi deteksi dan intervensi dini tumbuh kembang anak (SDIDTKA).\r\n\r\nKarena itu, saya menghimbau kepada seluruh orang tua yang mempunyai balita untuk rutin membawa anaknya ke Posyandu guna memantau pertumbuhan dan perkembangannya sebagai upaya meningkatkan kualitas sumber daya manusia Kota Tanjungpinang di masa yang akan datang," ajak Wakil Walikota\r\n\r\nWakil Walikota berpesan, kepada bayi dan balita yang belum berhasil menang jangan berkecil hati, karena semua balita disini adalah balita balita terbaik dan merupakan aset bangsa yang berkualitas," Mereka lah yang cikal bakal yang akan memimpin Kota dan bangsa ini ", ucapnya\r\n\r\nKepala Dinas Kesehatan, Pengendalian Penduduk dan Keluarga Berencana, Rustam, SKM, M. Si menjelaskan kegiatan ini dimaksud untuk meningkatkan pengetahuan orang tua terhadap tumbuh kembang balitanya sekaligus orang tua dan masyarakat berperan aktif untuk deteksi tumbuh kembang balita.\r\n\r\nPeserta dalam kegiatan ini sebanyak 100 balita. Mereka terbagi dalam kriteria kelompok umur, yaitu kriteria A kelompok umur 6 sampai 24 bulam sebanyak 50 peserta. Kriteria B kelompok umur 25 sampai 60 bulan sebanyak 50 peserta. Peserta merupakan juara dari Lomba Balita Sehat tingkat Kecamatan yang telah berlangsung beberapa waktu lalu.\r\n\r\nKriteria penilaian dilihat dari penilaian status balita dan orang tua, penilaian riwayat imunisasi, antropometri, pemeriksaan fisik, gigi dan mulut serta penilaian tumbuh kembang balita.\r\n\r\nUntuk tim juri berasal terdiri dari Dokter Spesialis Anak RSUP Kepri, Dokter Umum dan Dokter Gigi RSUD dan Puskesmas Batu 10 ", jelasnya\r\n\r\nAcara ini turut dihadiri, Sekretaris Daerah, Drs. Riono, M. Si, Staf Ahli, Ketua TP PKK Hj. Yuniarni Pustoko Weni, SH, Ketua GOW, Ersa Famella, Camat serta Lurah.(Humas).', 0, '2017-08-01', '2017-08-01', '2017-10-03 22:57:23', '1', '1', '1', '170801-Wakil Walikota Ayo Bawa Balita ke Posyandu', 0);
