	(2, 'SS', 'Informasi Tersedia Setiap Saat', 'Informasi Yang Tersedia Setiap Saat meliputi : Daftar Seluruh Informasi Publik yang berada di bawah penguasaannya, tidak termasuk informasi yang dikecualikan, hasil keputusan badan publik dan pertimbangannya, seluruh kebijakan yang ada berikut dokumen pendukungnya, rencana kerja proyek termasuk di dalamnya perkiraan pengeluaran tahunan Badan Publik, perjanjian Badan Publik dengan pihak ketiga, informasi dan kebijakan yang disampaikan Pejabat Publik dalam pertemuan yang terbuka untuk umum, prosedur kerja pegawai Badan Publik yang berkaitan dengan pelayanan masyarakat, dan / atau laporan mengenai pelayanan akses informasi publik. Untuk memperoleh informasi, wajib melakukan permohonan informasi kepada Pejabat Pengelola Informasi dan Dokumentasi (PPID)'),
	(3, 'BK', 'Informasi Berkala', 'Informasi yang wajib diumukan secara berkala (paling singkat 6 bulan sekali), Informasi yang berkaitan dengan Badan Publik, Informasi mengenai kegiatan dan kinerja Badan Publik terkait, Informasi mengenai Laporan Keuangan'),
